The overall model was significant, $F(9, 387) = 23.91, p < .001$. Conscientiousness, frequency of online access, and year in university explained approximately 34% of the variance in attendance. Both those with high and low levels of conscientiousness exhibited attendance rates that were significantly different than those with moderate levels of conscientiousness (see @fig-rq1(a)), when controlling for year of study and online access. Specifically, those with high levels of conscientiousness attended class significantly more often than those with moderate levels $(\beta = 7.37,~ SE = 1.39,~ t = 5.29,~ p < .001)$. Conversely, in comparison to those with moderate levels of conscientiousness, those with low levels attended class significantly less $(\beta = -10.29,~ SE = 1.4,~ t = -7.36,~ p < .001$). Both those who rarely $(\beta = -5.38,~ SE = 1.44,~ t = -3.73,~ p < .001)$ or often $(\beta = -3.53,~ SE = 1.34,~ t = -2.64,~ p = .009)$ accessed online materials had significantly lower attendance rates than those who accessed only sometimes regardless of Conscientiousness levels and year of study (see @fig-rq1(b)). Holding constant conscientiousness and frequency of online access to materials, all years of study, with the exception of Y3, had significantly higher attendance rates than those in Y1 (see @fig-rq1(c)).  



