![Estimated Attendance Means by Year of Study](1_10_writeup_recap2FIG_files/figure-html/fig-rq2-means-1.png){#fig-rq2-means fig-align='center' width=80%}
:::
:::



In relation to RQ3, there was a strong positive correlation between attendance and marks $(r_{(Attendance,~Grade)} = .91)$. Our fitted model failed to satisfy all regression assumptions (see Appendix C). Although our model met the linearity (though there was a slight curve in the loess line; see Appendix C @fig-rq3-assumpt-lin), and normality of residuals assumptions (there was a slight skew, but not of concern; see Appendix C @fig-rq3-assumpt-norm), the assumption of equal variances was violated as the spread of residuals was not constant and suggested that there was evidence of heteroscedasticity (see Appendix C @fig-rq3-assumpt-eqvar). Therefore, since we could not trust that the SEs in our model results were reliable, we bootstrapped. Results suggested that there was a significant positive association between marks and attendance (see @fig-rq3). Specifically, we are 95% confident that for every day one attends class, their final mark will increase, on average, between 0.93 and 1.07 points. As the 95% CI did not contain zero, we rejected the null hypothesis as there was evidence of a significant association between student‚Äô attendance and their final marks. 



